description:
Return of Colmcille

Arts Documentary hosted by Margo Harkin, published by BBC in 2013 - English narration


Information
------------------------------

The story of the City of Culture midsummer highlight in which writer Frank Cottrell Boyce joined the people of Derry-Londonderry to stage an epic confrontation between the Loch Ness monster and Colmcille on the River Foyle.

